import React, { Fragment } from 'react';
import Main from './components/pages/Main';
import Navbar from './components/layout/Navbar';
import './App.css';

import { Link, Redirect } from 'react-router-dom';

const App = () => {
  return (
    <div className="App">
      <Fragment>
        <Navbar />
        <Link to='/' />
        <Link to='/Login' />
      </Fragment>
    </div>
  );
}

export default App;
